import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import HomePage from "./pages/HomePage";
import OutfitTryOnPage from "./pages/OutfitTryOn";
import AIStylistPage from "./pages/AIStylistPage";
import FashionGamePage from "./pages/FashionGame";
import OutfitSelection from "./components/OutfitSelection";
import ARTryOn from "./components/ARTryOn";

const App = () => {
  const [selectedModel, setSelectedModel] = useState(null);

  return (
    <Router>
      <Switch>
        {/* Homepage Route */}
        <Route path="/" exact>
          <HomePage />
        </Route>

        {/* Outfit Try-On Route */}
        <Route path="/outfit-tryon">
          <OutfitTryOnPage>
            <OutfitSelection onSelect={setSelectedModel} />
            <ARTryOn selectedModel={selectedModel} />
          </OutfitTryOnPage>
        </Route>

        {/* AI Stylist Route */}
        <Route path="/ai-stylist">
          <AIStylistPage />
        </Route>

        {/* Fashion Game Route */}
        <Route path="/fashion-game">
          <FashionGamePage />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
